We need to group queries and exclude duplicate queries. Dataloader can do this. facebook gives a request-scope batch and caching solution. The following is an example of using DataLoader to optimize queries:: use async_graphql::*;
use async_graphql::dataloader::*;
use itertools::Itertools; struct UserNameLoader { pool: sqlx::Pool<Postgres>,
} #[async_trait::async_trait]
impl Loader<u64> for UserNameLoader { type Value = String; type Error = sqlx::Error; async fn load(&self, keys: &[u64]) -> Result<HashMap<u64, Self::Value>, Self::Error> { let pool = ctx.data_unchecked::<Pool<Postgres>>(); let query = format!("SELECT name FROM user WHERE id IN ({})", keys.iter().join(",")); Ok(sqlx::query_as(query) .fetch(&self.pool) .map_ok(|name: String| name) .try_collect().await?) }
} struct User { id: u64,
} #[Object]
impl User { async fn name(&self, ctx: &Context<'_>) -> Result<String> { let loader = ctx.data_unchecked::<DataLoader<UserNameLoader>>(); let name: Option<String> = loader.load_one(self.id).await?; name.ok_or_else(|| "Not found".into()) }
} In the end, only two SQLs are needed to query the results we want! SELECT id, todo, user_id FROM todo
